	  INNER JOIN @tblOfficerSub O ON O.NewOfficer = PL.OfficerID
	  WHERE 
	  ValidityTo IS NULL AND PolicyStage =''R'' AND EnrollDate >= @DateFrom AND EnrollDate <=@DateTo
	  )
END



' 
END
