	DECLARE @RelIndex as decimal(18,4)
	--DECLARE @ClaimValueG as decimal(18,2)
	--DECLARE @ClaimValueIP as decimal(18,2)
	--DECLARE @ClaimValueOP as decimal(18,2)
	
